import { styled } from "styled-components";
import YeonHeader from "../components/YeonHeader";
import {
  YeonSlider,
  CollectionSlider,
  KoreanSlider,
} from "../components/YeonSlider";

const MainSlider = styled.div`
  width: 100%;
  height: 370px;
`;
const ChartContainer = styled.div`
  width: 100%;
  height: 450px;
  background-color: skyblue;
`;
const ChartSelect = styled.div`
  width: 100%;
  height: 70px;
`;
const MainChart = styled.div``;
const ChartPiece = styled.div`
  height: 150px;
  display: flex;
  div {
    width: 20%;
  }
`;

const KaSlider = styled.div`
  width: 100%;
  height: 350px;
`;
const CollectionContainer = styled.div`
  width: 100%;
  height: 350px;
`;

function YeonJoo() {
  return (
    <>
      <YeonHeader />
      <MainSlider>
        <YeonSlider></YeonSlider>
      </MainSlider>
      <ChartContainer>
        <ChartSelect>
          <div>
            <div>Top</div>
            <div>New</div>
          </div>
          <div>
            <div>
              <div>1h</div>
              <div>6h</div>
              <div>24h</div>
              <div>7d</div>
            </div>
            <div>
              <select></select>
            </div>
            <div>view all</div>
          </div>
        </ChartSelect>
        <MainChart>
          <div>
            <div>Name</div>
            <div>price</div>
            <div>size</div>
            <div>Name</div>
            <div>price</div>
            <div>size</div>
          </div>
          <div>
            <div>1</div>
            <div>img</div>
            <div>Name</div>
            <div>price</div>
            <div>size</div>
          </div>
        </MainChart>
      </ChartContainer>
      <KaSlider>
        <h2>korean artist</h2>
        <KoreanSlider></KoreanSlider>
      </KaSlider>
      <CollectionContainer>
        <h2>collection title</h2>
        <CollectionSlider></CollectionSlider>
      </CollectionContainer>
      <CollectionContainer>
        <h2>collection title</h2>
        <CollectionSlider></CollectionSlider>
      </CollectionContainer>
      <CollectionContainer>
        <h2>collection title</h2>
        <CollectionSlider></CollectionSlider>
      </CollectionContainer>
    </>
  );
}

export default YeonJoo;
